import React from 'react';
import { Link } from 'react-router-dom';
import MusicList from "./content/MusicList.json"
import "./pages.css"
import "../index.css"

function Music() {
  return (
      <div className="MusicList">
      <h1>Music</h1>
      {MusicList.map((song,i) => {
        return(
            <div key={i} className="song-card">
              <h4 className="text_link"><Link to={`music/${song.id}`}>{song.title}</Link></h4>
            </div>
        )
      })}
      </div>
          );
        }

export default Music;
